import React from 'react';
import './Card.css'; 

const Card = ({ title, subTitle,description }) => {
  return (
    <div className="card">
      <div className="card-content">
        <div className="title">
          <i>{title}</i><br/>
          <i style={{color:'#3ca918'}}></i>
        </div>
        <div className="description">{description}</div>
      </div>
    </div>
  );
}

export default Card;
